import React,{ Component } from 'react';
import './App.css';
import Logged from './components/Model';
import axios from "axios"
// import {
//   BrowserRouter as Router,
//   Route,
//   Link
// } from 'react-router-dom'


export default class App extends Component {
  state={
    id:[],
    title:['Critical Hit','Critical Hit','Critical Hit','Critical Hit'],
    url:['http://placehold.it/300x300','http://placehold.it/300x300','http://placehold.it/300x300','http://placehold.it/300x300'],
    train_score:[0.8,0.7,0.8,0.7],
    test_score:[0.9,0.95,0.9,0.95],
  }

  getData=()=>{
    axios.get('main/')
    .then(data=>{
      let newState={...this.state}
      data.data.datum.map((item)=>{
        newState.id.push(item._id)
        newState.title.push(item.title)
        newState.url.push(item.url)
        newState.train_score.push(item.train_score)
        newState.test_score.push(item.test_score)
      })
      set

    })
  }

  componentDidMount(){
    this.getData()
  }
  render() {
    const info=this.state.title.map((item,index)=>{
      return <Logged url={this.state.url[index]} title={this.state.title[index]} train_score={this.state.train_score[index]} test_score={this.state.test_score[index]} key={index} />
    })
    return (
      <div>
      <nav className='bg-dark navbar-expand-lg text-right p-1'>
        <a href="#null" className='text-white'>Login</a>
      </nav>
      {info}
      <div className='col-12 col-sm-6 col-md-4 card_model'>
      <div className="card border-success mb-5">
      <h4 className="card-header text-center">Add New</h4>
      </div>
      </div>
      </div>
    )
  }
}
